Este soneto titulado "Rosa" fue escrito por la poetisa cubana Adelaida del Mármol (1838-1857), quien vivió durante el siglo XIX. Fue una de las primeras poetisas románticas de Cuba, aunque su vida fue muy breve, pues falleció a los 19 años.
